  drag(selector) {
    var total_ = this.total;
    var selector_ = selector;
    var parent = this;

    function update() {
      var arr = [];
      var total_width = total_;

      $(selector_)
        .find(".redline")
        .each(function () {
          var xx = Number($(this).position().left);
          var coor = xx.toFixed(1);
          arr.push(coor);
        });

      var old = 0;
      var r = 0;

      for (var i = 0; i < arr.length + 1; i++) {
        if (arr[i] == undefined) {
          r = Number(total_width - old);
        } else {
          r = Number(arr[i] - old);
        }

        r = r.toFixed(1);

        var no = i + 1;

        $(parent.label_input + " .inputbox:eq(" + i + ")").val(r);
        old = Number(arr[i]);
      }
    }

    Draggable.create(selector + " .redline", {
      type: "x",
      bounds: selector,
      throwProps: true,
      inertia: true,
      snap: function (value) {
        return 0.1;
      },
      onDrag: function (e) {
        update();
      },
    });
  }

