  constructor(
    pan,
    maesu,
    quantity,
    $dan,
    selector,
    input,
    cutsize_w,
    cutsize_h,
    sizemode,
    lines,
    val,
    device
  ) {
    if (pan == "a1") pan = "a2";
    this.pan = pan;
    this.maesu = Number(maesu);
    this.quantity = Number(quantity);
    this.$dan = $dan;
    this.label_selector = selector;
    this.label_input = input;
    this.cutsize_w = cutsize_w;
    this.cutsize_h = cutsize_h;
    this.lines = Number(lines);
    this.val = val;
    this.sizemode = sizemode;
    this.device = device;
    this.price = $dan.attr("data-price");

    //console.log('pan=>' + pan);

    this.set_unit_price();
    this.set_price();

    this.init(selector, input);
  }

  init(selector, input) {
    this.$holder = $(selector);
    this.$input = $(input);

    var big = Math.max(this.cutsize_w, this.cutsize_h);
    var small = Math.min(this.cutsize_w, this.cutsize_h);

    if (this.sizemode == "large") {
      this.total = Math.max(this.cutsize_w, this.cutsize_h);
      this.$holder.css({
        background: "#fff",
        width: big + "px",
        height: small + "px",
      });
    } else {
      this.total = Math.min(this.cutsize_h, this.cutsize_h);
      this.$holder.css({
        background: "#fff",
        width: small + "px",
        height: big + "px",
      });
    }

    this.paint(selector);

    var me = this;
    var $inputs = this.$input;

    this.$btnok.on("click", function (e) {
      e.preventDefault();
      var arr = [];
      var t = 0;

      $inputs.find('input[type="text"]').each(function () {
        t += Number($(this).val());
      });

      if (me.total != t) {
        alert("전체 사이즈가 맞지 않습니다.\n사이즈를 수정해 주세요.");

        if (me.lines == 1) {
          var gubun = me.total / 2;
          gubun = gubun.toFixed(1);
          me.$input.find(".inputbox:eq(0)").val(gubun);
          me.$input.find(".inputbox:eq(1)").val(gubun);
        } else if (me.lines == 2) {
          var gubun = me.total / 3;
          var gubun1 = gubun.toFixed(1);
          var gubun2 = gubun1 * 2;
          var input3 = me.total - gubun2;
          input3 = input3.toFixed(1);

          me.$input.find(".inputbox:eq(0)").val(gubun1);
          me.$input.find(".inputbox:eq(1)").val(gubun1);
          me.$input.find(".inputbox:eq(2)").val(gubun3);
        } else if (me.lines == 3) {
          var gubun = me.total / 4;
          var gubun1 = gubun.toFixed(1);
          var gubun2 = gubun1 * 2;
          var gubun3 = gubun1 * 3;
          var input4 = me.total - gubun3;
          let gubun4 = input4.toFixed(1);

          me.$input.find(".inputbox:eq(0)").val(gubun1);
          me.$input.find(".inputbox:eq(1)").val(gubun1);
          me.$input.find(".inputbox:eq(2)").val(gubun1);
          me.$input.find(".inputbox:eq(3)").val(gubun4);
        }

        me.repaint(me.label_selector, true);
        return false;
      }

      $inputs.find('input[type="text"]').each(function () {
        arr.push($(this).val());
      });

      me.repaint(me.label_selector, false);

      this.results = arr;
    });
  }

