  unit_price = 0;
  price = 0;

  constructor(
    tmp_pan,
    maesu,
    quantity,
    lines,
    selector,
    input,
    cutsize_w,
    cutsize_h,
    sizemode,
    device
  ) {
    if (tmp_pan == "a1") tmp_pan = "b2";
    this.tmp_pan = tmp_pan;
    this.maesu = Number(maesu);
    this.quantity = Number(quantity);
    this.lines = Number(lines);

    this.line_selector = selector;
    this.label_input = input;
    this.cutsize_w = Number(cutsize_w);
    this.cutsize_h = Number(cutsize_h);
    this.sizemode = sizemode;
    this.device = device;

    this.set_unit_price();
    this.set_price();
    this.init(selector, input);
  }

  init(selector, input) {
    this.$holder = $(selector);
    this.$input = $(input);

    let big = Math.max(this.cutsize_w, this.cutsize_h);
    let small = Math.min(this.cutsize_w, this.cutsize_h);

    if (this.sizemode == "large") {
      this.total = big;
      this.$holder.css({
        background: "#fff",
        width: big + "px",
        height: small + "px",
      });
    } else {
      this.total = small;
      this.$holder.css({
        background: "#fff",
        width: small + "px",
        height: big + "px",
      });
    }

    this.paint(selector);

    let me = this;
    let $inputs = this.$input;

    this.$btnok.on("click", function (e) {
      e.preventDefault();
      let arr = [];
      let t = 0;

      $inputs.find('input[type="text"]').each(function () {
        t += Number($(this).val());
      });

      if (me.total != t) {
        alert("전체 사이즈가 맞지 않습니다.\n사이즈를 수정해 주세요.");

        if (me.lines == 1) {
          let gubun = me.total / 2;
          gubun = gubun.toFixed(1);

          try {
            me.$input.find(".inputbox:eq(0)").val(gubun);
            me.$input.find(".inputbox:eq(1)").val(gubun);
          } catch (e) {}
        } else if (me.lines == 2) {
          let gubun = me.total / 3;
          let gubun1 = gubun.toFixed(1);
          let gubun2 = gubun1 * 2;
          let input3 = me.total - gubun2;
          input3 = input3.toFixed(1);

          try {
            me.$input.find(".inputbox:eq(0)").val(gubun1);
            me.$input.find(".inputbox:eq(1)").val(gubun1);
            me.$input.find(".inputbox:eq(2)").val(gubun3);
          } catch (e) {}
        } else if (me.lines == 3) {
          let gubun = me.total / 4;
          let gubun1 = gubun.toFixed(1);
          let gubun2 = gubun1 * 2;
          let gubun3 = gubun1 * 3;
          let input4 = me.total - gubun3;
          let gubun4 = input4.toFixed(1);

          try {
            me.$input.find(".inputbox:eq(0)").val(gubun1);
            me.$input.find(".inputbox:eq(1)").val(gubun1);
            me.$input.find(".inputbox:eq(2)").val(gubun1);
            me.$input.find(".inputbox:eq(3)").val(gubun4);
          } catch (e) {}
        }

        me.repaint(me.label_selector, true);
        return false;
      }

      $inputs.find('input[type="text"]').each(function () {
        arr.push($(this).val());
      });

      me.repaint(me.label_selector, false);

      this.results = arr;
    });
  }

