  set_unit_price() {
    let obj = null;
    let key = this.setPan2();
    let maesu = this.maesu;
    let obj2 = null;
    let big_maesu = 0;
    let small_maesu = 0;
    let big_price = 0;
    let small_price = 0;
    let unit_price = 0;

    if (maesu > 8000) maesu = 8000;

    obj = _.filter(this.$_prices, function (o) {
      return o.maesu == maesu;
    });

    //없는경우
    if (obj.length == 0) {
      obj = _.filter(this.$_prices, function (o) {
        return o.maesu >= maesu;
      });

      obj2 = _.sortBy(obj, "maesu");
      big_maesu = Number(obj2[0]["maesu"]);
      big_price = Number(obj2[0][key]);

      obj = _.filter(this.$_prices, function (o) {
        return o.maesu <= maesu;
      });

      obj2 = _.sortBy(obj, "maesu").reverse();

      small_maesu = Number(obj2[0]["maesu"]);
      small_price = Number(obj2[0][key]);

      let t1 =
        ((big_maesu - maesu) * (small_price - big_price)) /
          (big_maesu - small_maesu) +
        big_price;

      unit_price = t1;
    } else {
      unit_price = Number(obj[0][key]).toFixed(0);
    }

    this.unit_price = unit_price;
  }

  get get_unit_price() {
    return Number(this.unit_price);
  }

  set_price() {
    //40% UP
    const premium = 1.4;
    const p1 = this.unit_price * this.maesu * this.quantity * premium;
    const p2 = Math.round(p1 / 100) * 100;
    const min_price = 2000;

    this.price = Math.max(p2, min_price);
  }

  get get_price() {
    try {
      return Math.round(this.price / 100) * 100;
    } catch (err) {
      let code = "DST-1002";
      let where = "poster/d-procs.js:4439";
      let why = JSON.stringify($("#applyform").serializeObject());
      this.callError(code, where, err + " " + why);
    }
  }
